// Shoes.jsx
import React from 'react';

const Shoes = () => {
  const shoes = [
    { id: 1, name: 'Nike Mercurial', price: '$120' },
    { id: 2, name: 'Adidas Predator', price: '$110' },
    { id: 3, name: 'Puma Ultra', price: '$100' },
  ];

  return (
    <div>
      <h2>Shoes Category</h2>
      <ul>
        {shoes.map((shoe) => (
          <li key={shoe.id}>
            {shoe.name} - {shoe.price}
            <img src="https://i5.walmartimages.com/seo/Fashion-Running-Sneaker-for-Men-Shoes-Casual-Shoes-Leather-Sport-Shoes-Breathable-Comfortable-Walking-Shoes-Black-US11_8e9d44bb-b19b-42e9-bca1-979205c0779e.6fc41a815c10699375294302df46565a.jpeg
            " alt="shoes" />
            {shoes.map(shoe => (
  <div key={shoe.id} className="card m-2" style={{ width: '18rem' }}>
    <div className="card-body">
      <h5 className="card-title">{shoe.name}</h5>
      <p className="card-text">{shoe.price}</p>
      <button className="btn btn-primary">Add to Cart</button>
    </div>
  </div>
))}

          </li>
        ))}
      </ul>
    </div>
  );
};

export default Shoes;
